protected void parseOptimizationData(OptimizationData... optData) {
super.parseOptimizationData(optData);
for (OptimizationData data : optData) {
if (data instanceof ModelFunction) {
model = ((ModelFunction) data).getModelFunction();
continue;
if (data instanceof Target) {
target = ((Target) data).getTarget();
continue;
if (data instanceof Weight) {
weightMatrix = ((Weight) data).getWeight();
continue;
checkParameters();
}

private RealMatrix squareRoot(RealMatrix m) {
if (m instanceof DiagonalMatrix) {
final int dim = m.getRowDimension();
final RealMatrix sqrtM = new DiagonalMatrix(dim);
for (int i = 0; i < dim; i++) {
sqrtM.setEntry(i, i, FastMath.sqrt(m.getEntry(i, i)));
return sqrtM;
}

public static void checkMatrixIndex(final AnyMatrix m,
checkRowIndex(m, row);
checkColumnIndex(m, column);
}

public ArrayRealVector(double[] d, boolean copyArray)
throws NullArgumentException {
